duplication.codefragment:
private List<ClassificationData> sortClassificationData(final ProductModel productData,
		final List<ClassificationData> classificationDataS)
{
	if (CollectionUtils.isEmpty(classificationDataS))
	{
		return classificationDataS;
	}

	// create a mapping which is used to access the original data.
	// This mapping will prevent a nested for loop to cut down the complexity
	final Map<String, ClassificationData> mapping = new HashMap<>();
	for (final ClassificationData classificationData : classificationDataS)
	{
		mapping.put(classificationData.getCode(), classificationData);
	}

	final List<ClassificationData> result = new ArrayList<>();

	// load the parent classification using the wago convention
	final String parentClassCode = getParentClassCode(productData);
	final Optional<CategoryModel> categoryOpt = OptionalsHelper
			.firstOfNullableCollection(wagoCategoryService.getCategoriesForCode(parentClassCode));
	if (categoryOpt.isPresent())
	{
		// only one, exact match is expected
		final CategoryModel categoryModel = categoryOpt.get();

		LOG.debug("{} Code: {}", categoryModel.getName(), categoryModel.getCode());

		// access the sub classes. The parent-sub relation is ordered so here, the correct order is available
		final List<CategoryModel> nestedCategories = categoryModel.getNestedCategories();

		if (CollectionUtils.isEmpty(nestedCategories))
		{
			return classificationDataS;
		}

		// this loop will rearange the classification datas to adhere to the order that is impexed
		for (final CategoryModel nestedCategoryModel : nestedCategories)
		{
			// not every sub classification is actually assigned to the product so check for null first
			final String nestedCategoryCode = nestedCategoryModel.getCode();
			final ClassificationData match = mapping.get(nestedCategoryCode);
			if (null != match)
			{
				result.add(match);
				LOG.debug("{} Code: {}", nestedCategoryModel.getName(), nestedCategoryCode);
			}
		}
	}

	// append the non-matched in no particular order
	for (final ClassificationData classificationData : classificationDataS)
	{
		if (!result.contains(classificationData))
		{
			result.add(classificationData);
		}
	}

	return result;
}

