/**
 * Determines if there are matching tables to the given classificationData; also searches its sub classifications.
 *
 * @param tables
 * @param classificationDataList
 */
private void matchTables(final List<WagoProductFeatureTableData> tables,
		final Collection<ClassificationData> classificationDataList)
{
	for (final ClassificationData classificationData : classificationDataList)
	{
		final Optional<WagoProductFeatureTableData> matchOptional = findMatchingTable(tables, classificationData);
		addTableToClassificationData(classificationData, matchOptional);
		if (CollectionUtils.isNotEmpty(classificationData.getSubClassifications()))
		{
			matchTables(tables, classificationData.getSubClassifications());
		}
	}
}


/**
 * Searches given tables for a direct match with the given classification data.
 *
 * @param tables
 * @param classificationData
 * @return Optional of WagoProductFeatureTableData, possibly empty.
 */
private Optional<WagoProductFeatureTableData> findMatchingTable(final List<WagoProductFeatureTableData> tables,
		final ClassificationData classificationData)
{
	return tables.stream()
			.filter(table -> table.getType() != null
					&& table.getType().getClassificationClass() != null
					&& table.getType().getClassificationClass().getCode().equalsIgnoreCase(classificationData.getCode()))
			.findFirst();
}

/**
 * Adds given tableOptional if not null to the given classificationData's tables.
 * 
 * @param classificationData
 * @param tableOptional
 */
private void addTableToClassificationData(final ClassificationData classificationData,
		final Optional<WagoProductFeatureTableData> tableOptional)
{
	if (tableOptional.isPresent())
	{
		final WagoProductFeatureTableData table = tableOptional.get();
		if (classificationData.getTables() != null)
		{
			classificationData.getTables().add(table);
		}
		else
		{
			final List<WagoProductFeatureTableData> tables = new ArrayList<>();
			tables.add(table);
			classificationData.setTables(tables);
		}
	}
}

