/**
 * Check if the current classification class does not have any nested classification classes
 *
 * @param classificationClassModel
 * @return
 */
private boolean isLeafClassificationClass(final ClassificationClassModel classificationClassModel)
{
	return classificationClassModel.getNestedCategories()
			.stream()
			.noneMatch(ClassificationClassModel.class::isInstance);
}

/**
 * Check if the current classification class has a parent classification class which is not the very top
 * classification class.One classification should have only one classification class in theory in wago project.
 *
 *
 * @param classificationClassModel
 * @return
 */
private boolean hasNonTopLevelEmptyClassificationClass(final ClassificationClassModel classificationClassModel)
{
	final Optional<CategoryModel> containingClassificationClass = classificationClassModel.getContainingCategories()
			.stream()
			.filter(ClassificationClassModel.class::isInstance)
			.findFirst();

	if (containingClassificationClass.isPresent())
	{
		final Optional<CategoryModel> nonTopClassificationClass = containingClassificationClass.get().getContainingCategories()
				.stream()
				.filter(ClassificationClassModel.class::isInstance)
				.findFirst();
		if (nonTopClassificationClass.isPresent())
		{
			return CollectionUtils.isEmpty(nonTopClassificationClass.get().getCategoryClassificationAttributes());
		}
	}
	return false;
}

