/**
 * Recursive call - constructs the Classification tree.
 *
 * Merges newly converted ClassificationData with previously converted ClassificationData. This is important when the
 * classifications weren't addred in hierarchical order to a product.
 *
 * @param classificationData
 * @param topLevelClassifications
 */
private void mergeSubclassificationDatas(final ClassificationData classificationData,
		final Map<String, ClassificationData> topLevelClassifications)
{
	if (classificationData.getSubClassifications() == null)
	{
		return;
	}

	final Collection<ClassificationData> mergedSubclassifications = new ArrayList<>();

	for (final ClassificationData subclassification : classificationData.getSubClassifications())
	{
		final String subclassCode = subclassification.getCode();
		if (topLevelClassifications.containsKey(subclassCode))
		{
			// replace subclassification with previous one, which may already contain feature values
			mergedSubclassifications.add(topLevelClassifications.get(subclassCode));

			// subclassifications cannot be at top level
			topLevelClassifications.remove(subclassCode);
		}
		else
		{
			// keep
			mergedSubclassifications.add(subclassification);

			// check if there are duplicated classifications deeper down the hierarchy
			mergeSubclassificationDatas(subclassification, topLevelClassifications);
		}
	}

	classificationData.setSubClassifications(mergedSubclassifications);
}

