private ArrayList<ClassificationData> removeEmptyClassifications(final Collection<ClassificationData> classifications)
{
	final ArrayList<ClassificationData> optimizedClassifications = new ArrayList<>();
	if (classifications != null)
	{
		for (final ClassificationData classification : classifications)
		{
			// remove empty subclassifications
			classification.setSubClassifications(removeEmptyClassifications(classification.getSubClassifications()));

			if (!Collections.isEmpty(classification.getSubClassifications())
					|| !Collections.isEmpty(classification.getFeatures()))
			{
				LOG.debug("the non classification is {}", classification.getCode());
				optimizedClassifications.add(classification);
			}
		}
	}
	return optimizedClassifications;
}

