/**
 * Recursively searches ClassificationDataS in the hierarchy given their code.
 *
 * @param classificationClassCode
 * @param classificationList
 * @return
 */
private ClassificationData getClassificationDataFromHierarchy(final String classificationClassCode,
		final Collection<ClassificationData> classificationList)
{
	if (classificationList == null)
	{
		return null;
	}

	for (final ClassificationData classification : classificationList)
	{
		// if this is the classification, we can stop immediately
		if (classificationClassCode.equals(classification.getCode()))
		{
			return classification;
		}

		// else we'll check the subcategories recursively
		final ClassificationData foundClassification = getClassificationDataFromHierarchy(classificationClassCode,
				classification.getSubClassifications());
		if (foundClassification != null)
		{
			return foundClassification;
		}
	}
	// nothing found in this classification tree.
	return null;
}


