	protected int compareInstances(final DownloadCategoryData instance1, final DownloadCategoryData instance2)
	{
		/**
		 * Retrieves the priority of categories based on 'order' comparision as Integer. Also handles null values
		 *
		 * @param DownloadCategoryData
		 *           the data to be compared
		 * @return DownloadCategoryDataComparator
		 */
		final Integer order1 = instance1.getOrder();
		final Integer order2 = instance2.getOrder();

		if ((order1 == null) && (order2 == null))
		{
			return EQUAL;
		}
		if (order1 == null)
		{
			return AFTER;
		}
		if (order2 == null)
		{
			return BEFORE;
		}
		return Integer.compare(order1, order2);
	}

